import React from 'react';
import './App.css';
import Navigation from "./components/Navigation";

function App() {
  return (
    <div className="App">
        <Navigation />
      <h1>Welcome to developers Q/A Community!</h1>
      <p>Feel free to help or get help for/from community members!</p>
    </div>
  );
}

export default App;
